import { Component, Vue } from 'vue-property-decorator'
import HeadLable from '@/components/HeadLable/index.vue'

@Component({
  name: 'MaintenanceAcceptance',
  components: {
    HeadLable
  }
})
export default class extends Vue {
  private deviceName = ''
  private tableData = []
  private counts = 0
  private pageSize = 10
  private page = 1

  private created() {
    this.init()
  }

  private init(isSearch?: boolean) {
    // 这里实现数据获取逻辑
    // 模拟数据
    this.tableData = [
      {
        deviceName: '测试设备1',
        deviceCode: 'DEV001',
        maintenanceType: '日常保养',
        maintenanceContent: '清洁设备、检查零部件',
        maintenanceTime: '2023-05-01 10:00:00',
        status: '待验收'
      }
    ]
    this.counts = this.tableData.length
  }

  private handleSizeChange(val: number) {
    this.pageSize = val
    this.init()
  }

  private handleCurrentChange(val: number) {
    this.page = val
    this.init()
  }

  private handleReview(row: any) {
    // 处理验收逻辑
    this.$message.success('验收操作成功')
  }
}
